listitem.para:
Similar to references themselves, spans are subject to reference lifetime issues. The user is responsible for making sure the objects pointed to by a span live as long as the span is used. For example: std::vector<int> vec{1,2,3,4};
std::span<int> sp(vec);
vec.push_back(5);
printf("%i\n", sp.front()); // UB!

When a function accepts a span with a mutable element type, it will not accept temporaries; only variables or other references. For example: void FooMut(std::span<int> arg);

FooMut(std::vector<int>{1, 2, 3}); // Does not compile
std::vector<int> baz{1, 2, 3};
FooMut(baz); // Works
